import React from 'react';
import { Link} from "react-router-dom";

class Nav extends React.Component {
    render() {
        return (
            <div>
                <link rel="stylesheet" type="text/css" href="dashboard.css"/>
	<meta name="viewport" content="width=device-width, initial-scale=1"/>
	<link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.4.1/css/bootstrap.min.css"/>
	<script src="https://ajax.googleapis.com/ajax/libs/jquery/3.4.1/jquery.min.js"></script>
	<script src="https://maxcdn.bootstrapcdn.com/bootstrap/3.4.1/js/bootstrap.min.js"></script>
                <div class="wrapper">
              <div class="sidebar">
            <h2>Menu</h2>
            <ul>
                <li><a href="dashboard.html"><i class="fa fa-tachometer" aria-hidden="true"></i>Dashboard</a></li>
                <li class="active"><a href="managerole.html"><i class="fa fa-user" aria-hidden="true"></i>CreateRole</a>
                </li>
                <li><a href="manageusers.html"><i class="fa fa-desktop" aria-hidden="true"></i>Manage-Users</a></li>
                <li><a href="warehouses.html"><i class="fa fa-list" aria-hidden="true"></i>Manage</a></li>
                <li><a href="upload.html"><i class="fa fa-upload" aria-hidden="true"></i>Upload</a></li>
                <li><a href="reconcile.html"><i class="fa fa-id-card" aria-hidden="true"></i>Re-Concile</a></li>
                <li><a href="index.html"><i class="fa fa-sign-out" aria-hidden="true"></i>Logout</a></li>
            </ul>
        </div>
    </div>
            </div>

        );
    }
}

export default Nav;
